import *  as React from 'react';
import axios from 'axios';
// import Table from '@mui/material/Table';
// import TableBody from '@mui/material/TableBody';
// import TableCell from '@mui/material/TableCell';
// import TableContainer from '@mui/material/TableContainer';
// import TableHead from '@mui/material/TableHead';
// import TablePagination from '@mui/material/TablePagination';
// import TableRow from '@mui/material/TableRow';
// import TableSortLabel from '@mui/material/TableSortLabel';

export default function Servicestablejson2(){
    const [rows,setRows1]=React.useState<any[]>([]);

    const getProductData = async () => {
        try {
          const data = await axios.get(
            `https://my-json-server.typicode.com/sakthi-vunet/dummyjson/list`
          );

          setRows1(data.data);
          console.log(data);
        } catch (e) {
          console.log(e);
        }
      };
    React.useEffect(() => {
        getProductData();
    }, []);
    return(<div className="container">
        <div className="col-xs-8">
        <h1>React Axios Example</h1>
        <tbody>
        {rows.map((item,i) => (

          <tr key={i}>
          <td>{item.name}</td>
          <td>{item.type}</td>
          <td>{item.instances}</td>
          <td>{item.node}</td>
          <td>{JSON.stringify(item.nodelist,null, 2) }</td>
      </tr>
        ))}
        </tbody>
        </div>
       </div>)


}
